import React from "react";

const BannerSettings = ({ bannerName }) => {
  return (
    <div className="mb-3">
      <h5 className="font-weight-bold">Settings:</h5>

      <p className="my-0">
        Current Banner Type: <u>{bannerName.title}</u>
      </p>
    </div>
  );
};

export default BannerSettings;
